import { Text, View } from "react-native";
import styles from "./style";


export default function Areapix() {
    return (

        <View>
            <TouchableOpacity style={styles.OptionIcon} onPress={() => { navigation.navigate("/areapix") }}>
                <Ionicons name='cash-outline' size={30} color='#000' />
            </TouchableOpacity>
        </View>


    );
}
